let fThArea = thArea.RECORDS.map(it => {
    let a = {
        label: it.name,
        value: it.code,
    }
    if (it.level == "2") {
        a.parentValue = it.parent_code
    }
    if (it.level == "3") {
        a.parentValue = it.parent_code
        a.grandParentValue = it.province_code
    }
    return a
})

function listToTree(list) {
    let result = []
    if(!Array.isArray(list)) {
        return result
    }
    // 深度拷贝，不改变原数组对象
    let data = JSON.parse(JSON.stringify(list))
    data.forEach(item => {
        delete item.children;
    });
    let map = {};
    data.forEach(item => {
        map[item.value] = item;
    });
    data.forEach(item => {
        let parent = map[item.parentValue];
        if(parent) {
            (parent.children || (parent.children = [])).push(item);
        } else {
            result.push(item);
        }
    });
    return result;
}